import{_ as a,c as e,o as i,a2 as l}from"./chunks/framework.Cw_AIpAc.js";const o="/%E8%82%96%E7%94%B3%E5%85%8B%E7%9A%84%E6%95%91%E8%B5%8E.png",u=JSON.parse('{"title":"心路历程","description":"","frontmatter":{},"headers":[],"relativePath":"markdown-examples.md","filePath":"markdown-examples.md"}'),t={name:"markdown-examples.md"},r=l('<h1 id="心路历程" tabindex="-1">心路历程 <a class="header-anchor" href="#心路历程" aria-label="Permalink to &quot;心路历程&quot;">​</a></h1><p>21年高考结束，在高人引导下计算机......此处省略一万字。普本地狱开局，从一开始的懵懂无知到慢慢提升对行业认知，牛客、boss直聘、哔哩哔哩大学、网上的盗版课程、独立开发、offershow，骚年誓立秋招进大厂，美好的愿望随着时间的流逝一点一点淡忘，就像当初年少的自己给未来许下考取名校出人头地那样，现实是残酷的，骚年也越发觉得身心疲惫在code的世界中渐渐迷失......根本学不完，看着周围多数结丹修士都已成功结婴功成名就，而我还在修道的路上努力找到适合自己的功法秘籍，成功之路和其辛苦，道友且报有终生学习并谦逊的态路才能走的更加长远。🎉</p><p><img src="'+o+'" alt="关于自由和救赎"></p><h2 id="java转前端" tabindex="-1">Java转前端 <a class="header-anchor" href="#java转前端" aria-label="Permalink to &quot;Java转前端&quot;">​</a></h2><p>依稀记得大二那年秋天，22年互联网大环境很差根据网上收集到的资料以及当时java找不到Job的贴子热搜经常占据各个论坛榜首，但当时还是狠狠焦虑了一把。当时也就学了SQL和JavaSE，并没有把Java学习的很深入，经过深思熟虑之后依然决定转换赛道————前端。</p><h2 id="学习历程" tabindex="-1">学习历程 <a class="header-anchor" href="#学习历程" aria-label="Permalink to &quot;学习历程&quot;">​</a></h2><p>一开始按照学生思维和一些学习习惯（比如：观看视频教程、按照视频去敲代码，这其实很不好。有点像小时候老师罚我们抄课文那个路子，也不能这种方法不好，一开始可以先从这种方式开始后面在慢慢改变。第二就是没有经常阶段性的总结和反思）去学习前端。效果一般总是对某个知识点理解的不够透彻。 随着学习的深入和知识的沉淀，我慢慢的摆脱这种学习思路，开始学会总结和反思，并在开发中遇到的问题和一些知识进行总结，观摩技术论坛直播和大牛、大厂博客。</p><p>学习是一件痛苦并快乐着的事情，目前的技术还是很浅，在接下来的时间会去研究<strong>跨端</strong>、<strong>工程化</strong>和<strong>性能优化</strong>相关的知识，学海无涯苦作舟。👋</p><h2 id="实习经历" tabindex="-1">实习经历 <a class="header-anchor" href="#实习经历" aria-label="Permalink to &quot;实习经历&quot;">​</a></h2><h3 id="吉比特" tabindex="-1">吉比特 <a class="header-anchor" href="#吉比特" aria-label="Permalink to &quot;吉比特&quot;">​</a></h3><p>23年末开始投，总体时间线大概二十几天。第一次投简历和面试，和期待也很紧张，其中记忆深刻的就是被字节面试官狠狠拷打... 前前后后大概有7个左右的面试，幸运的是收获了3个offer(西安、北京)，最终选择了深圳的吉比特。🎉 💯</p><p><strong>面经</strong></p><ol><li>自我介绍</li><li>介绍了它们部门内部的具体业务</li><li>http加密相关</li><li>css水平垂直居中</li><li>若后端同时收到很多个请求该怎么办处理</li><li>服务端渲染</li><li>nginx</li><li>跨域及其解决方法</li><li>场景题: 给出具体场景并对数据库结构进行设计</li><li>快排-冒泡</li><li>前端性能优化</li><li>后端性能优化</li><li>数据库怎么设计才能实现高效查询</li><li>vue2/vue3响应式原理</li><li>webpack相关</li></ol><h3 id="美团" tabindex="-1">美团 <a class="header-anchor" href="#美团" aria-label="Permalink to &quot;美团&quot;">​</a></h3><p>从吉比特离职后在小黑屋（出租屋）里面的疯狂背题投简历，面试。那段时间过得浑浑噩噩，很多时候都重复着同样的事情，起床、面试、算题、睡觉，日复一日期间也收到了几家offer但是感觉都不太满意，后面又经历的腾讯、小米、快手、美团的拷打，最终被团子捞了，功夫不负有心人。<br> 匆匆忙忙的离开了深圳，其实对深圳这个城市还是有许多感情的，毕竟在那儿生活了几个月，楼下就是超市、快递、夜宵摊充满了人间烟火。</p><p>进入美团后我为大厂的规范化和流程化的工作方式和开发感到震惊，强大的前端基建和内部框架配合他们的生态系统形成了完善的开发部署流程，大大提升了工作效率。</p><p>工作氛围：同事们都很友好遇到问题都会耐心指导循循善诱，工作氛围轻松，美团应该是诸多互联网大厂强度比较一般的，偶尔加班，技术部的同学会晚一点。</p><h2 id="未完待续" tabindex="-1">未完待续 <a class="header-anchor" href="#未完待续" aria-label="Permalink to &quot;未完待续&quot;">​</a></h2><p>......未来未可知，没有人能轻易搅动命运轨迹，加油！</p>',19),n=[r];function s(h,p,d,c,_,m){return i(),e("div",null,n)}const b=a(t,[["render",s]]);export{u as __pageData,b as default};
